window.bookSummaryJSON = "<p>Three outlaw Cyborgs. One human female....</p> <p>Axel, Steel, and Gage. Merciless supersoldiers. Forbidden cybernetic experiments gone awry. They escaped from their Hurlian programmers and now live hidden in a desolate area of space where few enter and none leave. </p> <p>They crave one female to claim, one who will satisfy all their desires. But Cyborgs are illegal, so finding a mate has proven difficult. </p> <p>Until Megan.</p> <p>As a survivor of horrific abuse at the hands of her alien captors, this tiny female from the original planet is both strong and fierce. Her white-hot desire brings all three men to their knees. They want this female. Forever. </p> <p>But will she choose to live on the bleak edge of space with three exacting, contraband Cyborgs who have been stripped of human emotions? Or is their time up? Will the original programmers return for their ultimate weapons, destroying their female and all theyâ€™ve constructed?</p>"; 
